import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Stage, Layer, Line } from 'react-konva'; // Import react-konva components
import './MainPage.css'; // Import your CSS file

const MainPage = () => {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    navigate('/function'); // Navigate to the function page
  };

  return (
    <div className="main-content">
      <h1 className="title">ZOOM WEBINAR | 20 AUGUST THU | 4PM SGT</h1>
      <div className="sub-title">
        <span>THE FUTURE OF</span><br />
        <span>PHYSICAL SPACES</span>
      </div>

      <button onClick={handleButtonClick} className="cta-button">Get Started</button>

      {/* Canvas for diagonal lines */}
      <Stage width={window.innerWidth} height={window.innerHeight} style={{ position: 'absolute', top: 0, right: 0, zIndex: 1 }}>
        <Layer>
          {/* Left Diagonal Line */}
          <Line
            points={[-50, 0, 500, 800]} // Define the start and end points of the line
            stroke="#FFFFFF" // Line color
            strokeWidth={2} // Line width
          />

          {/* Right Diagonal Line */}
          <Line
            points={[window.innerWidth - 500, 0, window.innerWidth + 50, 800]} // Define the start and end points of the line
            stroke="#FFFFFF" // Line color
            strokeWidth={2} // Line width
          />
        </Layer>
      </Stage>
    </div>
  );
};

export default MainPage;
